GiNaC::ex ppsh_elimating_quadric_terms(GiNaC::ex const& POLYNOMIAL)
{
    GiNaC::ex POLYNOMIAL_NEW = POLYNOMIAL;
    GiNaC::ex MONINOMIAL_SUBS = 0;
    std::vector<GiNaC::ex> MONINOMIALS = ppsh_monomials_of(POLYNOMIAL);
    std::vector<int> COEFF_POW;
    std::vector<GiNaC::symbol> EMPTY_SYM_VEC;
    for (int INDEX_i = 0; INDEX_i < MONINOMIALS.size(); ++INDEX_i)
    {
        COEFF_POW = ppsh_coeff_pow_of(MONINOMIALS[INDEX_i],ITEMS_VARS_USED);
        if( std::count(COEFF_POW.begin(), COEFF_POW.end(), 1) < 2 ){continue;}
        if(QUADTRIC_TERMS_FACT_TAB.count(MONINOMIALS[INDEX_i]) > 0 ){continue;}
        QUADTRIC_TERMS_FACT_TAB[MONINOMIALS[INDEX_i]] = 0;
        QUADTRIC_TERMS_TAB[MONINOMIALS[INDEX_i]] = ITEMS_VARS_AUX[MAPPED_SYM_ID];
        VARS_MAP_TAB[ITEMS_VARS_AUX[MAPPED_SYM_ID]] = MONINOMIALS[INDEX_i];
        MAPPED_SYM_ID++;
        for (int INDEX_j = 0; INDEX_j < COEFF_POW.size(); ++INDEX_j)
        {
            if (COEFF_POW[INDEX_j]==1){QUADTRIC_TERMS_FACT_TAB[MONINOMIALS[INDEX_i]] += ITEMS_VARS_USED[INDEX_j];}
        }
    }
    /*for (GiNaC::exmap::iterator ITERATOR = QUADTRIC_TERMS_FACT_TAB.begin(); ITERATOR != QUADTRIC_TERMS_FACT_TAB.end(); ++ITERATOR)
    {
        cout<< ITERATOR->first <<" = "<< ITERATOR->second <<endl;
        cout<< ppsh_is_sub_poly( ITERATOR->second,POLYNOMIAL) <<endl;
    }*/
    for (int INDEX_i = 0; INDEX_i < MONINOMIALS.size(); ++INDEX_i)
    {
        COEFF_POW = ppsh_coeff_pow_of(MONINOMIALS[INDEX_i],ITEMS_VARS_USED);
        if( std::count(COEFF_POW.begin(), COEFF_POW.end(), 1) < 2 ){continue;}
        // --- xi*xj + xi + xj = z ---
        if(ppsh_is_sub_poly(QUADTRIC_TERMS_FACT_TAB[MONINOMIALS[INDEX_i]],POLYNOMIAL_NEW))
        {
            //cout<<"sub_poly = "<<QUADTRIC_TERMS_FACT_TAB[MONINOMIALS[INDEX_i]]<<" in: "<<POLYNOMIAL<<endl;
            if(QUADTRIC_TERMS_TAB.count(MONINOMIALS[INDEX_i] + QUADTRIC_TERMS_FACT_TAB[MONINOMIALS[INDEX_i]])==0 )
            {
                QUADTRIC_TERMS_TAB[ MONINOMIALS[INDEX_i] + QUADTRIC_TERMS_FACT_TAB[MONINOMIALS[INDEX_i]] ] = ITEMS_VARS_AUX[MAPPED_SYM_ID];
                VARS_MAP_TAB[ITEMS_VARS_AUX[MAPPED_SYM_ID]] = MONINOMIALS[INDEX_i] + QUADTRIC_TERMS_TAB[MONINOMIALS[INDEX_i]];
                MAPPED_SYM_ID++;
            }
            POLYNOMIAL_NEW = POLYNOMIAL_NEW - MONINOMIALS[INDEX_i] - QUADTRIC_TERMS_FACT_TAB[MONINOMIALS[INDEX_i]] + QUADTRIC_TERMS_TAB[MONINOMIALS[INDEX_i] + QUADTRIC_TERMS_FACT_TAB[MONINOMIALS[INDEX_i]]];
            continue;
        }
        // --- xi*xj = z ---
        POLYNOMIAL_NEW = POLYNOMIAL_NEW - MONINOMIALS[INDEX_i] + QUADTRIC_TERMS_TAB[MONINOMIALS[INDEX_i]];
    }
    return POLYNOMIAL_NEW;
}

